import { React } from "react";
import { useHistory } from "react-router-dom";
import "./styles.css";

const Drawer = () => {
  const history = useHistory();
  const handleHomeClick = () => {
    history.push("/");
  };
  const handlePopularClick = () => {
    history.push({
      pathname: "/goats",
      state: {
        filter: "goat",
      },
    });
  };
  const handleTrendingClick = () => {
    history.push("/");
  };
  const handleLatestClick = () => {
    history.push("/");
  };
  const handleUpcomingClick = () => {
    history.push("/");
  };
  const handleFavouritesClick = () => {
    history.push("/");
  };

  return (
    <>
      <div class="drawer-container">
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832604690.svg?token=exp=1628833526~hmac=0ce7dbe301cdc88bccf72a3c7f24f07c"
            alt=""
            onClick={handleHomeClick}
          />
        </div>
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832144100.svg?token=exp=1628833157~hmac=711dbe8d264a76a035e4ebf7a2e285a8"
            alt=""
            onClick={handlePopularClick}
          />
        </div>
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832183531.svg?token=exp=1628833157~hmac=db00865975cf463777dc54ecf4e7d6e9"
            alt=""
            onClick={handleTrendingClick}
          />
        </div>
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832431526.svg?token=exp=1628833385~hmac=5083e2aac93dd67101ae9ef463c6d196"
            alt=""
            onClick={handleLatestClick}
          />
        </div>
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832504320.svg?token=exp=1628833447~hmac=9ec039da94b62606e74e0013fb8a2429"
            alt=""
            onClick={handleUpcomingClick}
          />
        </div>
        <div class="drawer-menu-item">
          <img
            src="https://dw-iconusers.flaticon.com/23366/23366610/1628832401151.svg?token=exp=1628833385~hmac=c4a3b81387adc03323f6357c826adc5a"
            alt=""
            onClick={handleFavouritesClick}
          />
        </div>
      </div>
      <div class="expand-drawer">
        <img
          src="https://dw-iconusers.flaticon.com/23366/23366610/1628832933682.svg?token=exp=1628833840~hmac=ef5b06ad5d6edb08486e387ba9f57fc4"
          alt=""
        />
      </div>
    </>
  );
};

export default Drawer;
